import WebDev from "./servicesHoverImages/webDev.png"
import AndroidDev from "./servicesHoverImages/Android-app-development.jpg"
import ITSolutions from "./servicesHoverImages/ITSolutions.jpg"
import SoftwareDev from "./servicesHoverImages/SoftwareDev.jpg"
import SEO from "./servicesHoverImages/SEO.jpg"
import DigitalMarketing from "./servicesHoverImages/DigitalMarketing.jpg"
import DNR from "./servicesHoverImages/DNR.jpg"

const servicesData = [
  {
    sName: "Web Development",
    sImg: WebDev,
  },
  {
    sName: "Android Development",
    sImg: AndroidDev,
  },
  {
    sName: "IT Solutions",
    sImg: ITSolutions,
  },
  {
    sName: "Software Development",
    sImg: SoftwareDev,
  },
  {
    sName: "SEO",
    sImg: SEO,
  },

  {
    sName: "Digital Marketing",
    sImg: DigitalMarketing,
  },
  {
    sName: "Domain Registration",
    sImg: DNR,
  },
];
export default servicesData;
